import React, { useState, useEffect } from "react";

const AudioList = () => {
  const [audioFiles, setAudioFiles] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8080/audio", { method: "GET" })
      .then((response) => response.json())
      .then((data) => setAudioFiles(data))
      .catch((error) => console.error("Error fetching data:", error));
  }, []);

  handleAudioControls();

  return (
    <div>
      <h1>Play Audio Files</h1>
      <ul>
        {audioFiles.map((audioFile) => (
          <li key={audioFile.id}>
            <div>
              <div>
                <img
                  src={`data:image/jpeg;base64,${audioFile.image.data}`}
                  alt={audioFile.title}
                  style={{ maxWidth: "50px", maxHeight: "50px" }}
                />
              </div>
              <div>
                <div className="control play">
                  <span className="left"></span>
                  <span className="right"></span>
                  <span>
                    {audioFile.author} - {audioFile.title}
                  </span>
                </div>
              </div>
            </div>
          </li>
        ))}
      </ul>
      <div id="customControls" style={customControlsStyle}>
        <span id="customTrackName"></span>
        <div style={{ flexShrink: 0 }}>
          <img
            id="audioImage2"
            style={{ maxWidth: "50px", maxHeight: "50px" }}
          />
        </div>
        <audio
          id="customAudioPlayer"
          controls
          style={{ width: "100%" }}
          type="audio/mpeg"
        >
          Your browser does not support the audio element.
        </audio>
      </div>
    </div>
  );
};

const handleAudioControls = () => {
  document.addEventListener("DOMContentLoaded", function () {
    let currentAudioFileId = null;
    let currentAudioPlayer = null;

    // Get all elements with the class .control
    const controlElements = document.querySelectorAll(".control");
    const customAudioPlayer = document.getElementById("customAudioPlayer");
    const audioImage = document.getElementById("audioImage2");
    const customTrackName = document.getElementById("customTrackName");
    const customControls = document.getElementById("customControls");

    // Add a click event handler to each .control element
    controlElements.forEach((element) => {
      element.addEventListener("click", function () {
        const clickedAudioFileId = this.getAttribute("data-audio-id");

        // If a different audio file is clicked, pause the current one
        if (clickedAudioFileId !== currentAudioFileId) {
          pauseAllAudios();
          playAudio(this);
        } else {
          // Toggle play/pause for the clicked audio file
          if (customAudioPlayer.paused) {
            customAudioPlayer.play();
          } else {
            customAudioPlayer.pause();
          }
        }
      });
    });

    function playAudio(buttonElement) {
      const audioFileId = buttonElement.getAttribute("data-audio-id");
      const audioAuthor = buttonElement.getAttribute("data-audio-author");
      const audioTitle = buttonElement.getAttribute("data-audio-title");

      const src = "/audio/" + audioFileId;
      customAudioPlayer.src = src;
      audioImage.src = src + "/image";

      customTrackName.textContent = audioAuthor + " - " + audioTitle;

      customAudioPlayer.play();

      customControls.style.display = "block";

      // Update the current audio file ID and player reference
      currentAudioFileId = audioFileId;
      currentAudioPlayer = customAudioPlayer;
    }

    function pauseAllAudios() {
      // Pause all audio players
      controlElements.forEach((element) => {
        const audioPlayerId = element.getAttribute("data-audio-id");
        const audioPlayer = document.getElementById(
          "audioPlayer_" + audioPlayerId
        );
        if (audioPlayer && !audioPlayer.paused) {
          audioPlayer.pause();
        }
      });
    }
  });

  document.querySelectorAll(".control").forEach((element) => {
    element.addEventListener("click", function () {
      this.classList.toggle("pause");
      this.classList.toggle("play");
    });
  });
};

export default AudioList;
